class Solution(object):
    def addOperators(self, num, target):
        """
        :type num: str
        :type target: int
        :rtype: List[str]
        """

        def backtrack(num, target, op, res, path):
            if not num:
                if target == 0:
                    res.append(path)
                return
            for i in range(1, len(num) + 1):
                if i == 1 or num[0] != '0':
                    cur = int(num[:i])
                    if not path:
                        backtrack(num[i:], target - cur, cur, res, str(cur))
                    else:
                        backtrack(num[i:], target - cur, cur, res, path + '+' + str(cur))
                        backtrack(num[i:], target + cur, -cur, res, path + '-' + str(cur))
                        backtrack(num[i:], target - op + op * cur, op * cur, res, path + '*' + str(cur))
        res = []
        backtrack(num, target, 0, res, '')
        return res

