        """
        :type nums: List[int]
        :type k: int
        :rtype: int
        """

        nums.sort()
        left, right = 0, nums[-1] - nums[0]
        while left < right:
            mid = (left + right) // 2
            count = 0
            j = 0
            for i in range(len(nums)):
                while nums[i] - nums[j] > mid:
                    j += 1
                count += i - j
