            '6': ['m','n','o'],
            '7': ['p','q','r','s'],
            '8': ['t','u','v'],
            '9': ['w','x','y','z']
        }

        def backtrack(digits, index, path, res):
            if len(path) == len(digits):
                res.append(''.join(path))
                return

            for i in range(index, len(digits)):
                for letter in phone[digits[i]]:
                    path.append(letter)
                    backtrack(digits, i+1, path, res)
                    path.pop()

        res = []
        backtrack(digits, 0, [], res)
